import React from 'react'

function Coin({name, icon, price,symbol, rank}) {
  return (
    <div className="coin" style={{display: "flex", justifyContent: "center", alignItems: "center"}}>
        <h3 className="rank">#{rank}</h3>
        <img src={icon}/>
        <h1>{name}</h1>
        <h3>{symbol}</h3>
        <h3>{price.toFixed(2)}</h3>
    </div>
  )
}

export default Coin
